import React from 'react';
import { NavLink } from 'react-router-dom';

class Navigation extends React.Component {
    constructor(props){
        super(props)
    }
    render(){
        return <div style={styles.wraper}>
            <NavLink to='/'>Home</NavLink>
            <NavLink to='/Calculator'>Calculator</NavLink>
            <NavLink to='/GraphDisplay'>Display Graph</NavLink>
            <NavLink to='/Zeros'>Find Zeros</NavLink>
        </div>
    }
}

const styles={
    wraper: {
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-between',
        width: '50%',
        height: 80,
        alignItems: 'center',
        margin: 20
    }
}

export default Navigation;
